import React from 'react';
import github from '../../assets/img/github.png'
import linkedin from '../../assets/img/linkedin.png'
import twitter from '../../assets/img/twitter.png'

function Footer() {
    return (
        <div className="footerlinks">
            <a href="https://github.com/becketbowes">
                {/* <img src={github} alt="find me on github" /> */}
                github
            </a>
            <a href="https://www.linkedin.com/in/codeclast/" target="blank">
                {/* <img src={linkedin} alt="find me on linkedin" /> */}
                linkedin
            </a>
            <a href="https://twitter.com/becketbowes/status/395971206731419648?s=20&t=L0pTsZ2aTMmJ0kH5C9mXmg">
                {/* <img src={twitter} alt="find me on twitter" /> */}
            </a>
        </div>
    )
};

export default Footer;
